import React from "react";
import "../../style/GarageDetails.css";


class GarageDetails extends React.Component{
    render() {
        return (
            <div className="GarageDetails">
                <div className="header">
                    <h1 className="col-md-10">Garage</h1>
                    <button type="button" className=" col-md-2 btn btn-primary">Ajouter un garage</button>
                </div>
            </div>
        )
    }
}

export default GarageDetails;
